import React, { useState , useEffect} from "react";
import { useNavigate, useParams } from 'react-router-dom'

import jwt from 'jsonwebtoken';
import axios from 'axios';

function Profile() {

  const nav = useNavigate();

  useEffect(() => {
    const checkAuthorization = () => {
      console.log('AUTHENTICATING')
      const token = localStorage.getItem('token')
      if (token) {
        const user = jwt.decode(token)
        console.log('USER WHILE AUTHENTICATING : ', user)
        if (!user) {
          localStorage.removeItem('token')
          nav('/login')
        } else {
          setEmail(user.email)
        }
      } else nav('/login')
    }
    checkAuthorization()
  }, [nav])
  const { email } = useParams()
  const [name, setName] = useState('')
  const [dob, setDob] = useState('')
  const [phone, setPhone] = useState()
  const [qualifications, setQualifications] = useState()
  const [experience, setExperience] = useState()

  useEffect(() => {
    console.log("FETCHING");
    async function fetchProfile () {
      const res = await axios.post(
        'http://localhost:3000/user/profile',
        { email: email }
      )
      console.log("RES:", res);
      setName(res.data.jobApplicant.name)
      setDob(res.data.jobApplicant.dob)
      setPhone(res.data.jobApplicant.phone)
      setQualifications(res.data.jobApplicant.qualifications)
      setExperience(res.data.jobApplicant.experience)
    }
    fetchProfile();
  }, [email])

  const [editedName, setEditedName] = useState(name);
  const [editedDob, setEditedDob] = useState(dob);
  const [editedPhone, setEditedPhone] = useState(phone);
  const [editedQualifications, setEditedQualifications] = useState(qualifications);
  const [editedExperience, setEditedExperience] = useState(experience);
  const [isEditing, setIsEditing] = useState(false);



  



  const handleUpdate = () => {
    setIsEditing(true);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    axios.post('http://localhost:3000/user/update', {
      email: email,
      name: name,
      dob: dob,
      phone:phone,
      qualifications:qualifications,
      experience:experience
      
    })
    setIsEditing(false);
  };

  return (
    <div>
      <h1>Profile Page</h1>
      {isEditing ? (
        <form onSubmit={handleSubmit}>
          <label htmlFor="name">Name:</label>
          <input
            type="text"
            id="name"
            value={editedName}
            onChange={(event) => setEditedName(event.target.value)}
          />
          <br />
          <label htmlFor="dob">Date of Birth:</label>
          <input
            type="date"
            id="dob"
            value={editedDob}
            onChange={(event) => setEditedDob(event.target.value)}
          />
          <br />
  
          <br />
          <label htmlFor="phone">Phone Number:</label>
          <input
            type="tel"
            id="phone"
            value={editedPhone}
            onChange={(event) => setEditedPhone(event.target.value)}
          />
          <br />
          <label htmlFor="qualifications">Qualifications:</label>
          <textarea
            id="qualifications"
            value={editedQualifications}
            onChange={(event) => setEditedQualifications(event.target.value)}
          ></textarea>
          <br />
          <label htmlFor="experience">Experience:</label>
          <textarea
            id="experience"
            value={editedExperience}
            onChange={(event) => setEditedExperience(event.target.value)}
          ></textarea>
          <br />
          <button type="submit">Save</button>
        </form>
      ) : (
        <div>
          <p>Name: {editedName}</p>
          <p>Date of Birth: {editedDob}</p>
          <p>Email: {email}</p>
          <p>Phone Number: {editedPhone}</p>
          <p>Qualifications: {editedQualifications}</p>
          <p>Experience: {editedExperience}</p>
          <button onClick={handleUpdate}>Update</button>
        </div>
      )}
    </div>
  );
}

export default Profile;
